import React from 'react';
import './styles.css'; // 引入CSS文件

// Header组件
const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <img src="static/media/header-img.f0502cf9a0b6ce866525.png" alt="header" className="desktop" />
        <div className="wrapper">
          <div className="offer">
            <h1 className="title">Create your dream with us! Enjoy!</h1>
            <p>Our team offers a wide range of services. We work professionally and responsibly. You won't be disappointed!</p>
            <a href="#Contact" className="btn">Learn more...</a>
          </div>
        </div>
      </div>
    </header>
  );
};

// Wish组件
const Wish = ({ title, description }) => {
  return (
    <div className="wish">
      <h3 className="wish__title">{title}</h3>
      <p className="wish__text">{description}</p>
    </div>
  );
};

// Wishes组件
const Wishes = () => {
  return (
    <section className="expect" id="expect">
      <div className="container">
        <h2 className="section-title heading1">What do you need?</h2>
        <div className="wishes">
          <Wish title="First Element" description="Lorem ipsum dolor sit amet consectetur adipisicing elit." />
          <Wish title="Second Element" description="Lorem ipsum dolor sit amet consectetur adipisicing elit." />
          <Wish title="Third Element" description="Lorem ipsum dolor sit amet consectetur adipisicing elit." />
        </div>
      </div>
    </section>
  );
};

// ContactForm组件
const ContactForm = () => {
  return (
    <section id="mail" className="mail">
      <div className="container">
        <h2 className="section-title heading1">Callback order form</h2>
        <form action="#" className="form" id="Contact">
          <input type="text" name="name" id="name" placeholder="Name" className="input" required />
          <input type="email" placeholder="Enter your E-mail" name="email" className="input" required />
          <input type="tel" name="tel" id="tel" placeholder="Phone" className="input" required />
          <input type="text" name="place" id="place" placeholder="What topic are you interested in?" className="input" />
          <button type="submit" className="btn btn-form">Submit a question!</button>
        </form>
      </div>
    </section>
  );
};

// Footer组件
const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p className="footer__text">&copy; &nbsp;Everything on this site is protected</p>
      </div>
    </footer>
  );
};

// App组件
const App = () => {
  return (
    <div>
      <Header />
      <Wishes />
      <ContactForm />
      <Footer />
    </div>
  );
};

export default App;
